import React from "react";
import ChildCallback from "./CartWidget";
import App from "../App";

const PropsCallback = ({ value, onRefAdd, onRefSubtract }) => {
  return (
    <div style={{ display: 'flex', alignItems: 'center' }}>
      <div style={{
        display: 'flex',
        alignItems: 'center',
        border: '1px solid black',
        borderRadius: '5px',
      }}>
        <ChildCallback
          onClick={onRefSubtract}
          text='-'
          style={{
            width: '2rem',
            border: 'none',
            backgroundColor: 'white',
            borderTopLeftRadius: '5px',
            borderBottomLeftRadius: '5px',
            cursor: 'pointer',
            color: 'blue'
          }}
        />
        <span style={{
          width: '2rem',
          textAlign: 'center',
          border: 'none',
          backgroundColor: 'white',
          cursor: 'default',
          color: 'orange',
          fontSize: '15px'
        }}>
          {value}
        </span>
        <ChildCallback
          onClick={onRefAdd}
          text='+'
          style={{
            width: '2rem',
            border: 'none',
            backgroundColor: 'white',
            borderTopRightRadius: '5px',
            borderBottomRightRadius: '5px',
            cursor: 'pointer',
            color: 'blue'
          }}
        />
      </div>
    </div>
  );
};

export default PropsCallback;
